import React from "react";
import "./styles/App.css";
import {BrowserRouter} from "react-router-dom";
import Navbar from "./component/UI/navbar/Navbar";
import AppRouter from "./component/UI/appRouter/AppRouter";

const App = () => {
    return (
        <div>
            <BrowserRouter>
                <Navbar/>
                <AppRouter/>
            </BrowserRouter>
        </div>
    )
}

export default App;
